import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div>
        <div className='portfolio'>
            Portfolio
            <ul className='portfolio-lists'>
                <li>
                    Home
                </li>

                <li>
                    Blog
                </li>

                <li>
                    SNS
                </li>
            </ul>
        </div>
    </div>
  )
}

export default Header;
